import React from "react";

const Pagination = () => {
  let next = ({ setPageNumber }) => {};
  let prev = () => {
    setPageNumber((x) => x + 1);
  };

  return (
    <div className="container">
      <button onClick={prev} className="btn btn-primary">
        Prev
      </button>
      <button onClick={next} className="btn btn-primary">
        Next
      </button>
    </div>
  );
};

export default Pagination;
